import React from 'react';

const Card = ({ name, price, id, time, month, region }) => {
  const fish_id = id+1
  const time_display = time?time:'随机'
  let month_display = ''
  if (region !== '') 
  	{month_display = <p>Month: {month?month:'常见'} </p>}

  return (
  	<div className="card">
      <img alt='fish' src={`https://acnhapi.com/v1/images/fish/${fish_id}?size=200x200`} />
        <h4>{name}</h4>
        <p>价格: {price}</p>
        <p>时间: {time_display}</p>
        {month_display}
    </div>
  );
}

export default Card;
